            //s = "This is a group for anyone interested in road cycling in Swansea. Looking for people who are familiar with road biking who know some good routes (I know some) I am not looking to lead rides, and anyone who comes is responsible for themselves, just looking to find a few Road Bike Buddies to cycle with regularly.";
            s = "Ben Afflecks film Argo tells the bizarre story of how in 1980 the CIA - with Canadian help - sprang a group of Americans from Iran after they escaped a US embassy overrun by protestors. The film, which has received seven Oscar nominations including one for best picture, is based on real-life events. But how much of it is fiction? When Mark Lijek took Tehran as his first posting in the US foreign service, he knew he wasnt opting for an easy life. \"I was asked to volunteer in October 1978 and things in Iran were already pretty bad,\" he explains. \"There were violent demonstrations on the streets and it wasnt at all clear the Shah could survive. Then in January he abdicated and left the country\". Mark did a six-month course in Farsi before arriving in Iran in the summer of 1979, followed by his wife. Cora Lijek wasnt a foreign service official but was given a contract because the embassy urgently needed Farsi speakers. The couple couldnt have guessed how quickly they would find themselves in extraordinary circumstances. The US embassy in Tehran consisted of 26 acres surrounded by more than a mile of wall, with only 13 marines to protect it. Not long before Marks arrival it had been overrun by anti-American protestors who had left after a few hours. So when demonstrators again broke in, early on 4 November 1979, Mark initially assumed the same thing might happen. \"Mainly the protest was because America had chosen to admit the Shah for medical treatment. The consular building, where Cora and I worked, was at least five minutes from the main chancery building and had its own door onto the street. \"The people who broke in forgot about us or initially didnt much care\". Image caption Ben Affleck (centre) both directs and stars in Argo, which came out in the UK last year Mark Lijek, now retired, is impressed with how Ben Affleck stages the taking of the US embassy in Argo, a sequence filmed partly in Istanbul and partly on location in California. \"It was almost the first time Id thought deeply about what it must have been like for the 50 or so Americans in the main building,\" he tells the BBC. \"Those scenes were quite difficult to watch\". It is after the six Americans slip away from the embassy that Argo becomes a masterclass in reshaping reality into a Hollywood hit. ";
            //s = "El Clasico has been billed as a direct battle between Cristiano Ronaldo and Lionel Messi, unquestionably the world’s two best footballers, ever since the former joined the latter in La Liga back in 2009. On Sunday, at the Santiago Bernabeu, it was Messi who emerged triumphant. The Argentina international scored two goals, including a dramatic late winner, as Barcelona secured a last-gasp 3-2 victory over bitter rivals Real Madrid.";
            //s = "Netflix just wont stop making big movies. In a year thats already seen hit original releases like Burning Sands, Girlfriends Day, and The Discovery, comes Sand Castle, a war drama starring Nicholas Hoult and Henry Cavill. Youd think with big stars like that the movie would get a theatrical release, but nope, Netflix scooped it up. But regardless of how the movie makes its way to viewers, its content is important and timely, as it takes place during the Iraq War. So knowing that, you may be wondering: is Sand Castle based on a true story? In a way, yes. The film is the debut script from screenwriter Chris Roessner, who based it on his own experiences as a machine gunner for the army in Iraqs Sunni Triangle in 2003. The film tells the story of a group of American soldiers who find themselves in a dangerous situation trying to save the Iraqi village of Baqubah. Roessner, who enlisted in the armed forces when he was just 17, says he got the idea to become a screenwriter after watching Platoon in Saddam Husseins palace. Heres what he told henrycavill.org about the films genesis: I served in the U.S. Army and was deployed to Iraq during the initial invasion. This was 2003-2004. I spent a year there and, even before, knew I wanted to be a filmmaker. I remember seeing Oliver Stone’s film Platoon at 3 am. I was in Saddam Hussein’s palace in Tikrit and the film ended just as the sun was coming up. It was a moment changed my life. I thought... I had no idea you could make a film so deeply personal, so poetic, about the journey through war and the search for meaning. It wasn’t a ‘mission’ movie. That is to say it wasn’t a film about one particular goal, but it was more experiential. It was a film about searching, about the struggle for a young man to keep his soul intact even though the war was trying to corrupt it. I wanted to do something akin to that. You could trace this movie back to that moment in 2004. And while some characters and details of the film are based on Roessners own war experiences, the film itself is not a recreation of something that actually happened to him. Its inspired by his experiences, but its not necessarily based on a true story. In an interview with Go Into The Storys Scott Myers back in 2013, after Roessners script had made the 2012 Black List but before it had been picked up, the writer admits that the main plot of the movie, which has to do with repairing an aqueduct in the village, didnt even come about until his third or fourth draft: The aqueduct is one of those devices that didn’t show up until several drafts in. This movie didn’t have a plot until the third or fourth draft. It was just a bunch of scenes on a clothesline, not really relating to each other. We talked about Bridge on the River Kwai and I think that’s how we stumbled onto the aqueduct as the story that would be the thrust of the war but also something that wasn’t arbitrary. So while Sand Castle is inspired by Chris Roessners real army experience, its not necessarily based on an actual event. However, its still a very accurate portrayal of what life was like in the Iraq War, written by someone who knows.";
            //s = "Health care or healthcare is the maintenance or improvement of health via the diagnosis, treatment, and prevention of disease, illness, injury, and other physical and mental impairments in human beings. Healthcare is delivered by health professionals (providers or practitioners) in allied health professions, chiropractic, physicians, physician associates, dentistry, midwifery, nursing, medicine, optometry, pharmacy, psychology, and other health professions. It includes the work done in providing primary care, secondary care, and tertiary care, as well as in public health. Access to healthcare varies across countries, groups, and individuals, largely influenced by social and economic conditions as well as the health policies in place. Countries and jurisdictions have different policies and plans in relation to the personal and population-based health care goals within their societies. Healthcare systems are organizations established to meet the health needs of target populations. Their exact configuration varies between national and subnational entities. In some countries and jurisdictions, healthcare planning is distributed among market participants, whereas in others, planning occurs more centrally among governments or other coordinating bodies. In all cases, according to the World Health Organization (WHO), a well-functioning healthcare system requires a robust financing mechanism; a well-trained and adequately-paid workforce; reliable information on which to base decisions and policies; and well maintained health facilities and logistics to deliver quality medicines and technologies.";
            //s = "he remains of a mastodon discovered during a routine excavation in California shows possible human activity in North America 130,000 years ago -- or about 115,000 years earlier than previously thought. Paleontologists with the San Diego Natural History Museum discovered the remains of the elephant-like animal more than 20 years ago. But it wasn't until now that scientists were able to accurately date the findings, and possibly rewrite the history of the New World as we know it. ";
            //s = "The EPA removed most climate change information from its website Friday, saying in a press release that language on the website is being updated to reflect the approach of new leadership. EPA Administrator Scott Pruitt has expressed doubt about the reasons for climate change, saying in a CNBC interview in March that he was skeptical of the role carbon dioxide plays. I think that measuring with precision human activity on the climate is something very challenging to do, and there tremendous disagreement about the degree of impact, Pruitt said. So, no, I would not agree that it a primary contributor to the global warming that we see. J.P. Freire, the EPA associate administrator for public affairs, said the agency wants to eliminate confusion by removing outdated language first and making room to discuss how we're protecting the environment and human health by partnering with states and working within the law. Visitors to the website now find most climate change information is being updated, although the page that addresses climate change in the water sector still reflects a basic assessment that global warming is affecting water and precipitation. These impacts are likely to affect the programs designed to protect water quality, public health, and safety, the web page says. Environmental groups were dismayed by the EPA removal of climate change information from its website. Speaking at the DC protest on climate change issues Saturday, a Sierra club spokesperson told CNN the move is a sad reflection on the priorities of Donald Trump and EPA Administrator Scott Pruitt. If they haven't gotten the message yet, they're about to get it today. The American people want a government to fight for the health of this planet and for climate action to help protect all families in America.";
            //s = "George Walker Bush (born July 6, 1946) is an American politician who served as the 43rd President of the United States from 2001 to 2009. He was also the 46th Governor of Texas from 1995 to 2000. After graduating from Yale University in 1968 and Harvard Business School in 1975, he worked in the oil industry. Bush married Laura Welch in 1977 and ran unsuccessfully for the House of Representatives shortly thereafter. He later co-owned the Texas Rangers baseball team before defeating Ann Richards in the 1994 Texas gubernatorial election. Bush was elected president in 2000 after a close and controversial win over Democratic rival Al Gore, becoming the fourth president to be elected while receiving fewer popular votes than his opponent. From a prominent political family, he is the eldest son of Barbara and George H. W. Bush, the 41st President of the United States, making him only the second president to assume the nation's highest office after his father, following the lead of John Quincy Adams. His brother, Jeb Bush, a former Governor of Florida, was a candidate for the Republican presidential nomination in the 2016 presidential election. His paternal grandfather, Prescott Bush, was a United States Senator from Connecticut. The September 11 terrorist attacks occurred eight months into Bush's first term as president. Bush responded with what became known as the Bush Doctrine: launching a \"War on Terror\", an international military campaign that included the war in Afghanistan in 2001 and the Iraq War in 2003. He also promoted policies on the economy, health care, education, Social Security reform, and amending the Constitution to prohibit same-sex marriage. He signed into law broad tax cuts, the Patriot Act, the No Child Left Behind Act, the Partial-Birth Abortion Ban Act, Medicare prescription drug benefits for seniors, and funding for the AIDS relief program known as PEPFAR. His tenure included national debates on immigration, Social Security, electronic surveillance, and torture. In the 2004 Presidential race, Bush defeated Democratic Senator John Kerry in another relatively close election. After his re-election, Bush received increasingly heated criticism from across the political spectrum for his handling of the Iraq War, Hurricane Katrina, and other challenges. Amid this criticism, the Democratic Party regained control of Congress in the 2006 elections. In December 2007, the United States entered its longest post-World War II recession, often referred to as the \"Great Recession\", prompting the Bush administration to obtain congressional passage of multiple economic programs intended to preserve the country's financial system. Nationally, Bush was both one of the most popular and unpopular presidents in history, having received the highest recorded presidential approval ratings in the wake of the September 11 attacks, as well as one of the lowest approval ratings during the 2008 financial crisis. Bush left office in 2009, returning to Texas where he purchased a home in Crawford. He wrote a memoir, Decision Points. His presidential library was opened in 2013. His presidency has been ranked among the worst in historians' polls published in the late 2000s and 2010s.";
            //s = "Wave propagation related to high-speed train. A scaled boundary FE-approach for unbounded domains. Analysis of wave propagation in solid materials under moving loads is a topic of great interest in railway engineering. The objective of the paper is three-dimensional modelling of high-speed train related ground vibrations; in particular the question of how to account for the unbounded media is addressed. For efficient and accurate modelling of railway structural components taking the unbounded media into account, a hybrid method based on a combination of the conventional finite element method and scaled boundary finite element method is established. In the paper, element matrices and solution procedures for the scaled boundary finite element method (SBFEM) are derived. A non-linear finite element iteration scheme using Lagrange multipliers and coupling between the unbounded domain and the finite element domain are also discussed. Two numerical examples including one example demonstrating the dynamical response of a railroad section are presented to demonstrate the performance of the proposed method";
            //s = "This paper describes the organization and results of the automatic keyphrase extraction task held at the Workshop on Semantic Evaluation 2010 (SemEval-2010). The keyphrase extraction task was specifically geared towards scientific articles. Systems were automatically evaluated by matching their extracted keyphrases against those assigned by the authors as well as the readers to the same documents. We outline the task, present the overall ranking of the submitted systems, and discuss the improvements to the state-of-the-art in keyphrase extraction.";
            //s = "SBC gets more serious on regulatory compliance With one eye on the past and the other on its future, SBC Communications last 	week created a unit it hopes will bring a cohesiveness and efficiency 	to its regulatory compliance efforts that previously had been lacking. 	The carrier also hopes the new regulatory compliance unit will help it 	accomplish its short-term goal of landing FCC approval. to provide 	long-distance service throughout its region, and its longer-term, goal 	of reducing the regulatory burdens under which it and currently operate";
