            //s = "A clothing-optional bike ride is a cycling event in which nudity is permitted or expected. There are many clothing-optional cycling events around the world. Some rides are political, recreational, artistic or a unique combination. Some are used to promote topfreedom, a social movement to accord women and girls the right to be topless in public where men and boys have that right. This event takes place around the World on 20th of June each year. Body art (such as body painting) are common forms of creative expression, as well as costumes, art bikes, portable sound reinforcement systems (such as public address systems/bullhorns, and boomboxes), musical instruments as well as other types of noisemakers.";
            //s = "The bill establishes criminal and civil penalties for local government entities and law enforcement that don't comply with federal immigration laws and detainer requests.";
            //s = "The “accidental hero” who halted the global spread of an unprecedented ransomware attack by registering a garbled domain name hidden in the malware has warned the attack could be rebooted. The ransomware used in Friday’s attack wreaked havoc on organisations including FedEx and Telefónica, as well as the UK’s National Health Service (NHS), where operations were cancelled, X-rays, test results and patient records became unavailable and phones did not work. But the spread of the attack was brought to a sudden halt when one UK cybersecurity researcher tweeting as @malwaretechblog, with the help of Darien Huss from security firm Proofpoint, found and inadvertently activated a “kill switch” in the malicious software.";
            //s = "The WannaCry ransomware attack that spread around the globe yesterday caused chaos at hospitals, manufacturing shutdowns, headaches for Microsoft, and overtime for cybersecurity professionals. But the hackers responsible for this absurd attack have made relatively little in the way of profits. According to an analysis by respected security researcher Brian Krebs, the hackers have thus far only pulled in about $26,000 for perpetrating what is believed to be one of the largest ransomware attacks in history. With the initial charge to unlock users’ data set at a very reasonable $300, the hackers would have to get a payout from a lot of victims to hit the billion dollar figure that some were initially predicting.";
            //s = "    According to a detailed writeup on the Wana ransomware published Friday by security firm Redsocks, Wana contains three bitcoin payment addresses that are hard-coded into the malware. One of the nice things about Bitcoin is that anyone can view all of the historic transactions tied a given Bitcoin payment address. As a result, it’s possible to tell how much the criminals at the helm of this crimeware spree have made so far and how many victims have paid the ransom.";
            //s="In 2009, Elliot Turner launched AlchemyAPI to process the written word, with all of its quirks and nuances, and got immediate traction. That first month, the company's eponymous language-analysis API processed 500,000 transactions.  it's processing three billion transactions a month, or about 1,200 a second. “That's a growth rate of 6,000 times over three years,” touts Turner. Context is super-important, he adds. I'm dying is different than I'm dying to buy the new iPhone. “As we move into new markets, we're going to be making some new hires, Turner says. We knocked down some walls and added 2,000 square feet to our office. We're providing the ability to translate human language in the form of web pages and documents into actionable data, Turner says. Clients include Walmart, PR Newswire and numerous publishers and advertising networks. “This allows a news organization to detect what a person likes to read about,” says Turner of publishers and advertisers.";
            //s = "Computational linguistics is an interdisciplinary field concerned with the statistical or rule-based modeling of natural language from a computational perspective. Traditionally, computational linguistics was performed by computer scientists who had specialized in the application of computers to the processing of a natural language. Today, computational linguists often work as members of interdisciplinary teams, which can include regular linguists, experts in the target language, and computer scientists. In general, computational linguistics draws upon the involvement of linguists, computer scientists, experts in artificial intelligence, mathematicians, logicians, philosophers, cognitive scientists, cognitive psychologists, psycholinguists, anthropologists and neuroscientists, among others.";
            //s = "Muslims taking liberties! Praying on the sacred grounds of Westminster Abbey!";
            //s = "After software vulnerabilities exploited and leaked by the NSA were used by cybercriminals to infect as many as 200,000 Windows PCs with ransomware over the last three days, Microsoft has criticized government agencies for hoarding those flaws and keeping them secret. One particular vulnerability in Windows, leaked by a shady crew called Shadow Brokers, was used by the WannaCry hackers to give their ransomware a worm feature, allowing it to spread between vulnerable PCs silently and at speed. That flaw was exploited by a tool called EternalBlue and was patched by Microsoft in mid-March, but those who didn't apply the update were still open to attack, resulting in the mammoth attack starting Friday that infected 48 UK National Health Service, FedEx, Telefonica, Renault and Nissan car manufacturing plants, U.S. universities, Russian governments and Chinese ATMs, amongst many other systems across 150 countries. Microsoft president and chief legal officer Brad Smith said by keeping software weaknesses secret, vendors are left in the dark, can't issue updates, and their customers are left vulnerable to attacks such as the one that exploded this weekend. he compared the leak of NSA exploits to the theft of missiles from the American military, pointing also to the Wikileaks dump of CIA hacking tools.";
