            //s = "Bomb squads swooped on a home in the Manchester suburb of Fallowfield to carry out a controlled explosion as part of an ongoing terrorism investigation, according to police. Residents in Fallowfield posted footage of armed police close to a house on Elsmore Road. Some took to Twitter to report loud explosions. Police have also raided a property in nearby Whalley Range.";
