            //s = "Modeling privacy control in context-aware systems. Significant complexity issues challenge designers of context-aware systems with privacy control. Information spaces provide a way to organize information, resources, and services around important privacy-relevant contextual factors. In this article, we describe a theoretical model for privacy control in context-aware systems based on a core abstraction of information spaces. We have previously focused on deriving socially based privacy objectives in pervasive computing environments. Building on Ravi Sandhu's four-layer OM-AM (objectives, models, architectures, and mechanisms) idea, we aim to use information spaces to construct a model for privacy control that supports our socially based privacy objectives. We also discuss how we can introduce decentralization, a desirable property for many pervasive computing systems, into our information space model, using unified privacy tagging";
            // 2196.abstr

            //s = "ConChat: a context-aware chat program. ConChat is a context-aware chat program that enriches electronic communication by providing contextual information and resolving potential semantic conflicts between users. ConChat uses contextual information to improve electronic communication. Using contextual cues, users can infer during a conversation what the other person is doing and what is happening in his or her immediate surroundings. For example, if a user learns that the other person is talking with somebody else or is involved in some urgent activity, he or she knows to expect a slower response. Conversely, if the user learns that the other person is sitting in a meeting directly related to the conversation, he or she then knows to respond more quickly. Also, by informing users about the other person context and tagging potentially ambiguous chat messages, ConChat explores how context can improve electronic communication by reducing semantic conflicts";
            //s = "A context-aware decision engine for content adaptation. Building a good content adaptation service for mobile devices poses many challenges. To meet these challenges, this quality-of-service-aware decision engine automatically negotiates for the appropriate adaptation decision for synthesizing an optimal content version";
            //s = "Labscape: a smart environment for the cell biology laboratory. Labscape is a smart environment that we designed to improve the experience of people who work in a cell biology laboratory. Our goal in creating it was to simplify, laboratory work by making information available where it is needed and by collecting and organizing data where and when it is created into a formal representation that others can understand and process. By helping biologists produce a more complete record of their work with less effort, Labscape is designed to foster improved collaboration in conjunction with increased individual efficiency and satisfaction. A user-driven system, although technologically conservative, embraces a central goal of ubiquitous computing: to enhance the ability to perform domain tasks through fluid interaction with computational resources. Smart environments could soon replace the pen and paper commonly used in the laboratory setting";
            //s = "WATCH LIVE: president Donald J. Trump and First Lady Melania Trump arrive at the Western Wall in Israel. president Donald J. Trump is the first sitting U.S. president to visit the Western Wall.";
            //s="Activity and location recognition using wearable sensors. Using measured acceleration and angular velocity data gathered through inexpensive, wearable sensors, this dead-reckoning method can determine a user location, detect transitions between preselected locations, and recognize and classify sitting, standing, and walking behaviors. Experiments demonstrate the proposed method's effectiveness";
            //s = "Reconfigurable context-sensitive middleware for pervasive computing. Context-sensitive applications need data from sensors, devices, and user actions, and might need ad_hoc communication support to dynamically discover new devices and engage in spontaneous information exchange. Reconfigurable Context-Sensitive Middleware facilitates the development and runtime operations of context-sensitive pervasive computing software";
            //s = "Disability-related special libraries. One of the ways that the federal government works to improve services to people with disabilities is to fund disability-related information centers and clearinghouses that provide information resources and referrals to disabled individuals, their family members, service providers, and the general public. The Teaching Research Division of Western Oregon University operates two federally funded information centers for people with disabilities: OBIRN (the Oregon Brain Injury Resource Network) and DB-LINK (the National Information Clearinghouse on Children who are Deaf-Blind). Both have developed in-depth library collections and services in addition to typical clearinghouse services. The authors describe how OBIRN and DB-LINK were designed and developed, and how they are currently structured and maintained. Both information centers use many of the same strategies and tools in day-to-day operations, but differ in a number of ways, including materials and clientele";
            //s = "Waiting for the wave to crest wavelength services. Wavelength services have been hyped ad nauseam for years. But despite their quick turn-up time and impressive margins, such services have yet to live up to the industry's expectations. The reasons for this lukewarm reception are many, not the least of which is the confusion that still surrounds the technology, but most industry observers are still convinced that wavelength services with ultimately flourish";
            //s = "1) Ruth Madoff (née Alpern; born May 18, 1941) is the wife of Bernie Madoff, the convicted American financial fraudster. She was director of Bernard L. Madoff Investment Securities";
            //s = "Bernard Lawrence Bernie Madoff meɪdɒf born April 29, 1938 is an American fraudster and a former stockbroker, investment advisor, and financier. He is the former non-executive chairman of the NASDAQ stock market, and the admitted operator of a Ponzi scheme that is considered the affinity   fraud in U.S. history. Prosecutors estimated the size of the fraud to be $64.8 billion, based on the amounts in the accounts of Madoff 4,800 clients as of November 30, 2008. Madoff founded the Wall Street firm Bernard L. Madoff Investment Securities LLC in 1960, and was its chairman until his arrest on December 11, 2008. The firm was one of the top market maker businesses on Wall Street, which bypassed specialist firms by directly executing orders over the counter from retail brokers.[8] At the firm, he employed his brother Peter as senior managing director and chief compliance officer, Peter's daughter Shana Madoff, as the firm's rules and compliance officer and attorney and his sons Andrew and Mark. Peter has since been sentenced to 10 years in prison[9] and Mark committed suicide by hanging exactly two years after his father's arrest. Andrew died of lymphoma on September 3, 2014";
            //s = "On Friday, the World Health Organization (WHO) said India health ministry had confirmed three cases of the mosquito-borne virus from the city of Ahmedabad in western Gujarat state. Authorities in Gujarat said the cases were reported in a bustling neighbourhood between November 2016 and February 2017. The infection has been linked to severe birth defects in almost 30 countries. These include microcephaly, where babies are born with abnormally small heads and restricted brain development. Although the virus is mostly spread by mosquitoes, it can also be sexually transmitted.";
