            //s = "dear Hassan, Please find the attached paper that I have went through. I have marked changes that I have made as well as addressed some issues as comments. Concentrate in finishing the paper as a whole before you go through the version I have sent to you. It is a very good work. I should congratulate you first. I am happy with the majority of the paper, especially the introduction and the relevant works – you have improved a lot since last paper.  The reading in some parts is very intense – some part the notions outweigh their explanation.  If the algorithm is based on an existing one, no need to list all its notions, but only the relevant ones, the ones that you have updated. Those that you decide not to include, explain in plain words how it is obtained and try to make it easier for the readers. Best wishes Coral";
            //s = "dear Hassan, I hope you had a good rest and recovers well. I went through the paper today. It was a complex matter to take care of various version and I tried my best to integrate the version I’ve done, add the part you have changed/added, and correct mainly on the part you have done recently. Would you please work mainly on the version I send to you. Accept or reject my revisions and fix the part I have commented, and add abstract.  It would save a lot of time if we both work on an agreed version. There is also the matter to do with formatting and we will not know how much we must cut until we know how much we are over the limitation. As for the reducing the size, please could you, as the main author, look into different parts of the paper and make the decision and do the action? After you have done it, please send it back to me and I will go through them again – hopefully it is the final😊 Best wishes Coral";
            //s = "Call for Papers. 2017 IEEE International Conference on Big Data  (IEEE Big Data 2017). December 11-14, 2017,  Boston, MA, USA. In recent years, “Big Data” has become a new ubiquitous term. Big Data is transforming science, engineering, medicine, healthcare, finance, business, and ultimately our society itself. The IEEE Big Data conference series started in 2013 has established itself as the top tier research conference in Big Data. The first conference IEEE Big Data 2013 had more than 400 registered participants from 40 countries ( http://cci.drexel.edu/bigdata/bigdata2013/) and the regular paper acceptance  rate is 17.0%. The IEEE Big Data 2016 ( http://cci.drexel.edu/bigdata/bigdata2016/ ,  regular paper acceptance rate: 18.7%) was held in Washington DC, Dec 5-8, 2016 with close to 900 registered participants from 43 countries. The 2017 IEEE International Conference on Big Data (IEEE Big Data 2017) will continue the success of the previous IEEE Big Data conferences. It will provide a leading forum for disseminating the latest results in Big Data Research, Development, and Applications. We solicit high-quality original research papers (and significant work-in-progress papers) in any aspect of Big Data with emphasis on 5Vs (Volume, Velocity, Variety, Value and Veracity), including the Big Data challenges in scientific and engineering, social, sensor/IoT/IoE, and multimedia (audio, video, image, etc.) big data systems and applications. Example topics of interest includes but is not limited to the following: 1. Big Data Science and Foundations, a. Novel Theoretical Models for Big Data, b. New Computational Models for Big Data, c. Data and Information Quality for Big Data, d. New Data Standards";
            //s = "1) e.g. “McDonald's“ [shares] have climbed to record highs as the company delivers on its promise to cut costs and improve services (or xxx). Part of the deal is its installing self-order kiosks in 2,500 restaurants by the end of 2017 and in thousands more by 2021.";
