            //s = "Welcome to Reuters news on Facebook. We share news from around the world. Thanks for joining our community - we encourage comments";
            //s = "The trajectory of Fight Club is baffling. In its first hour or so, this picture appears to be a gloriously spiteful and well-acted satire of our bogus contemporary \"crisis of masculinity\": self-pitying guys hugging in groups and claiming victim status - modern consumer society having allegedly rendered the poor dears' hunter-gathering instincts obsolete. But, by the end, it has unravelled catastrophically into a strident, shallow, pretentious bore with a \"twist\" ending that doesn't work. And it is a film which smugly flirts, oh-so-very-controversially, with some of the intellectual and cultural paraphernalia of fascism - but does not have anything like the nerve, still less the cerebral equipment, to back this pose up. Edward Norton gives a compulsively twitchy, nerdy, hollow-eyed performance as Fight Club's Narrator: a 30-year-old single guy with a white collar job in the automotive industry and a secret addiction; he loves attending support groups posing as a sufferer. Hilariously, this is the only thing that gives him an emotional high. Fight Club has a classic scene where he turns up at a testicular cancer victims' group and the participants have to pair off, hugging, sobbing and letting it all out. He teams up with Robert - a cracking performance from the singer Meat Loaf (no kidding) - who has grown tits after his balls have been cut off. How pathetic is that? How metaphorical is that? ";
            //s = "A depressed man (Edward Norton) suffering from insomnia meets a strange soap salesman named Tyler Durden (Brad Pitt) and soon finds himself living in his squalid house after his perfect apartment is destroyed. The two bored men form an underground club with strict rules and fight other men who are fed up with their mundane lives. Their perfect partnership frays when Marla (Helena Bonham Carter), a fellow support group crasher, attracts Tyler's attention.";
            //s = "A suspect with face tattoos is being hunted by police after two cousins were sprayed with ‘acid’ as they were celebrating a 21st birthday. Jameel Muhktar and Resham Khan were left with ‘life changing’ injuries on 9..15am last Wednesday as the pair were celebrating Resham’s 21st birthday. £10,000 raised for acid attack victim Resham Khan in just one day John Tomlin, 24, is now wanted for questioning and should not be approached by the public, the Met Police have warned. Jameel, 37, is said to be ‘unrecognisable’ following the attack and had surgery earlier this week to treat his horrific injuries. Resham and Jameel had stopped at traffic lights when they were approached by a man who threw the toxic substance at Resham through the window. The attacker then ran around the car to throw more acid at Jameel before fleeing the scene in Tollgate Road, Canning Town, east London. Read more: http://metro.co.uk/2017/06/29/man-with-crying-tattoos-and-a-large-left-ear-wanted-over-two-acid-attacks-6742567/#ixzz4lRxFicIK";
