            //s = "Keyphrases  are  widely  used  as  a  brief summary   of   documents. Since   manual  assignment  is  time-consuming,  various  unsupervised  ranking  methods  based on  importance  scores  are  proposed  for keyphrase  extraction. In  practice,   the keyphrases of a document should not only be   statistically   important   in   the   document,  but  also  have  a  good  coverage  of the  document. Based  on  this  observation, we propose an unsupervised method for   keyphrase   extraction. Firstly,   the method finds exemplar terms by leveraging  clustering  techniques,  which  guarantees the document to be semantically covered  by  these  exemplar  terms.   Then  the keyphrases  are  extracted  from  the  document  using  the  exemplar  terms. Our method outperforms sate-of-the-art graph-based   ranking   methods   (TextRank)   by 9.5% in F1-measure.";
            //s = "Keyphrases provide important semantic metadata for organizing and manag-ing free-text documents. As data grow exponentially, there is a pressing de-mand for automatic and efficient keyphrase extraction methods. We intro-duce in this paper SemCluster, a clustering-based unsupervised keyphrase extraction method. By integrating an internal ontology (i.e., WordNet) with external knowledge sources, SemCluster identifies and extracts semantically important terms from a given document, clusters the terms, and, using the clustering results as heuristics, identifies the most representative phrases and singles them out as keyphrases. SemCluster is evaluated against two baseline unsupervised methods, TextRank and KeyCluster, over the Inspec dataset under an F1-measure metric. The evaluation results clearly show that Sem-Cluster outperforms both methods.";
            //s = "The Dixie Chicks were most recently in the spotlight at last year's Country Music Awards, where they shared the stage with Beyonce.";
            //s = "PDL Apps Store is the 3rd party applications gallery for the personal datalake development platform. The store applications provide the ability to ingest, preprocess, manage, and query the user's personal data in the personal datalake ecosystem. The store gallery is the central applications repository used by data providers, users, and data consumers. ";
            //s= "Ted, the world's most adorably inappropriate teddy bear, is back on June 26 with Ted 2 — and this time, he brought some new friends along. In the second film, Mark Wahlberg and Seth MacFarlane (who also directs and writes the movie) are back once more as Thunder Buddies, John and Ted. Joining them? Mamma Mia actress and newcomer to the franchise Amanda Seyfried as the female lead, a pot smoking lawyer named Sam L. Jackson (see what they did there?) who is representing Ted in a civil rights case to be recognized as a real person in a court of law. The new faces don't just end with Seyfried's addition, though — the many Ted 2 celebrity cameos are as hilarious as they are blatantly random.";
            //s = "George Walker Bush (born July 6, 1946) is an American politician who served as the 43rd President of the United States from 2001 to 2009. He was also the 46th Governor of Texas from 1995 to 2000. After graduating from Yale University in 1968 and Harvard Business School in 1975, he worked in the oil industry. Bush married Laura Welch in 1977 and ran unsuccessfully for the House of Representatives shortly thereafter. He later co-owned the Texas Rangers baseball team before defeating Ann Richards in the 1994 Texas gubernatorial election. Bush was elected president in 2000 after a close and controversial win over Democratic rival Al Gore, becoming the fourth president to be elected while receiving fewer popular votes than his opponent.";
            //s = "Ex-top climate official very concerned by global lack of progress. DURBAN, South Africa - Yvo de Boer said he left his job as the U.N.'s top climate official in frustration 18 months ago, believing the process of negotiating a meaningful climate agreement is failing. His opinion hasn't changed. I still have the same view of the process that led me to leave the process,  he told the Associated Press on Sunday.  I'm still deeply concerned about where it's going, or rather where it's not going, about the lack of progress.  For three years until 2010, the Dutch civil servant was the leading voice on global warming on the world stage. He appeared constantly in public to advocate green policies, traveled endlessly for private meetings with top leaders and labored with negotiators seeking ways to finesse snags in drafting agreements. In the end he felt he  wasn't really able to contribute as I should be to the process,  he said. Today, he can take a long view on his years as a Dutch negotiator in the 1990s and later as a senior U.N. official with access to the highest levels of government, business and civil society. He is able to voice criticisms he was reluctant to air when he was actively shepherding climate diplomacy. Negotiators live  in a separate universe,  and the ongoing talks are  like a log that's drifted away,  he said. Then, using another metaphor, he called the annual 194-nation conferences  a bit of a mouse wheel. Elsewhere in Durban Sunday, the South African host of the talks called for divine help at a climate change church service organized by the South African Council of Churches. We needed to pray for [an] acceptable, balanced outcome, that has a sense of urgency,  said Maite Nkoana-Mashabane, who as South Africa's foreign minister is president of the Durban round of negotiations. Negotiators have been at the job so long - since the 1992 climate convention - that they have lost touch with the real world, he said. But it wasn't their fault. I completely understand that it is very difficult for a negotiator to move if you haven't been given a political sense of direction and the political space to move,  he said. Rather than act in their own national interests, many leaders look to see what others are willing - or unwilling - to concede. You've got a bunch of international leaders sitting 85 stories up on the edge of a building saying to each other, 'You jump first and I'll follow.' And there is understandably a reluctance to be the first one to jump,  he said. source: http://www.washingtontimes.com/news/2011/dec/4/ex-top-climate-official-very-concerned-by-global-l/";
            // Issue : Royal Marines is lost because of NNP entity generalization
            //s = "Prince Philip has retired from 65 years of royal engagements with a trademark quip that Royal Marines should be “locked up” for their fundraising efforts. He was meeting troops who have just taken part in a gargantuan 1,664-mile trek. The finale of the 1664 Global Challenge, which recognises the year the Royal Marines were founded, was held in Buckingham Palace’s forecourt on Wednesday. The Duke of Edinburgh, who is Captain General of the Royal Marines, met two Corporals who have run 1,664 miles over 100 days.";
            s = "Theresa Mary May is a British politician who has served as Prime Minister of the United Kingdom and Leader of the Conservative Party since July 2016, the second woman to hold both positions. She has been the Member of Parliament (MP) for Maidenhead since 1997. Ideologically, she identifies herself as a one-nation conservative. The daughter of Zaidee Brasier (née Barnes) and Hubert Brasier, a vicar, May grew up in Oxfordshire. From 1977 until 1983, she worked for the Bank of England, and from 1985 until 1997 at the Association for Payment Clearing Services, also serving as a councillor for Durnsford in Merton. After unsuccessful attempts to be elected to the House of Commons in 1992 and 1994, she was elected as the MP for Maidenhead in the 1997 general election. From 1999 to 2010, May held a number of roles in the Shadow Cabinets of William Hague, Iain Duncan Smith, Michael Howard, and David Cameron, including Shadow Transport Secretary and Shadow Work and Pensions Secretary. She was also Chairman of the Conservative Party from 2002 to 2003.";
            //s = "Barcelona torrid summer was dealt a new blow yesterday when they were beaten 2-0 by fierce rivals Real Madrid in the Spanish Super Cup. The Catalan giants lost Neymar to Paris Saint-Germain earlier this month and have so far failed to complete deals for Liverpool’s Philippe Coutinho and Borussia Dortmund’s Ousmane Dembele. And Spanish outlet Diario Gol claims Messi is losing patience, to such an extent that his future at the Nou Camp is now growing uncertain.  He was reported to have signed a new Barcelona contract in July but, despite the club announcing he had, that does not appear to be the case. Lionel Messi wanted success in the short and long term guaranteed, yet their problems this summer have made him have second thoughts about extending his current deal.";
            //s = "Barcelona announced Lionel Messi new contract on July 5. Six weeks have passed and there still seems no sign of him signing it. Having lost Neymar to PSG it remains a mystery why the deal has not been closed. In January Messi would, in theory, be at liberty to sit down with other clubs. Next summer he would be a free agent. Here, Sportsmail answers the key questions on the Argentine's mega-money deal. ";
            //s = "A Democratic congressman became the latest legislator to draft impeachment articles against President Donald J. Trump, saying he failed to adequately delineate between neo-Nazis and their opponents in Charlottesville.";
            //s = "Canadian Ben Johnson left  the Olympics today  in  a complete state of shock,” accused of cheating with drugs in  the  world’s  fastest 100-meter dash and  stripped  of his gold medal. The  prize  went  to   Carl Lewis. Many athletes accepted the accusation that Johnson used a muscle-building but dangerous and illegal anabolic steroid, called Stanozolol as confirmation of what they said they know has been going on in track and field. Two tests of Johnson’s urine sample proved positive and his  denials  of drug use were  rejected  today. This  is a blow for the Olympic Games and the Olympic movement, said International Olympic Committee President Juan Antonio Samaranch";
            //s = "In computing, a Trojan horse, or Trojan, is any malicious computer program which misleads users of its true intent. The term is derived from the Ancient Greek story of the deceptive wooden horse that led to the fall of the city of Troy. Trojans are generally spread by some form of social engineering, for example where a user is duped into executing an e-mail attachment disguised to be unsuspicious, (e.g., a routine form to be filled in), or by drive-by download. Although their payload can be anything, many modern forms act as a backdoor, contacting a controller which can then have unauthorized access to the affected computer.[6] Trojans may allow an attacker to access users' personal information such as banking information, passwords, or personal identity (IP address). It can infect other devices connected to the network. Ransomware attacks are often carried out using a Trojan.";

            //s = "The Art of War is an ancient Chinese military treatise dating from the Spring and Autumn period in 5th century BC. The work, which is attributed to the ancient Chinese military strategist Sun Tzu ( Master Sun, also spelled Sunzi ), is composed of 13 chapters. Each one is devoted to a distinct aspect of warfare and how that applies to military strategy and tactics. For almost 1,500 years it was the lead text in an anthology that would be formalised as the Seven Military Classics by Emperor Shenzong of Song in 1080.";
            //s = "During his reign, Emperor Shenzong became interested in Wang Anshi's policies and appointed Wang as the Chancellor. Wang implemented his famous New Policies aimed at improving the situation for the peasantry and unemployed, which some have seen as a forerunner of the modern welfare state. These acts became the hallmark reform of Emperor Shenzong's reign.";
            
            //s = "THERE are growing signs that Hurricane Andrew, unwelcome as it was for the devastated inhabitants of Florida and Louisiana, may in the end do no harm to the re-election campaign of President George Bush. After a faltering and heavily criticised initial response to the disaster, both the president and his administration seem finally to be getting assistance to those rendered homeless and to businesses and farms that have been destroyed. In the process, Mr Bush has been able to call on the power of incumbency, the one asset denied his presidential rival, Mr Bill Clinton, who is to visit Florida today. This was brought home graphically by the president's announcement that Homestead Air Force base in Florida - a major local employer virtually destroyed by Andrew  - would be rebuilt. His poignant and brief address to the nation on Tuesday night, committing the government to pay the emergency relief costs and calling on Americans to contribute to the American Red Cross, also struck the right sort of note. It was only his tenth such televised speech from the Oval Office, itself atestimony to the gravity of the situation.";
            //s = "Just weeks ago, the prospects for the North American free trade agreement seemed assured. The proposed pact between the US, Canada and Mexico had the support of the Republican establishment, of Governor Bill Clinton, the prospective Democratic nominee, of the powerful Texas Democrats on Capitol Hill and most of the Democratic leadership in Congress. But the outpouring of public disaffection for 'politics as usual' has pushed to the forefront of many polls in the US election campaign Mr Ross Perot, the Texas billionaire. His campaign for the presidency is stressing jobs, and he has said a Nafta pact would send jobs to Mexico. The White House has taken its own polls and remains convinced that President Bush's support for Nafta is a winning issue. Although many working class Hispanic Americans believe Nafta would cost jobs, the Latino business organisations cautiously support the pact.";

            //s = "Texas (Reuters) – The eye of Hurricane Harvey began to push onto the Texas coast on Friday bringing with it winds of up to 156 miles per hour and 13-foot ocean surges as the most powerful storm in over a decade bore down on the mainland United States."; 
            //s = "Most powerful storm to hit the US since 2005 hits the coast as a category 4 storm. Follow live updates here. Patrick Rios, the mayor of the town of Rockport, where the Hurricane Harvey has hit, has urged residents who chose to stay to write their social security numbers on their arms to make it easier for rescuers to identify them.";


            //DUC-2001 Test
            s = "    A study has found that the U.S. death toll from a major hurricane could be far worse than previously predicted, the head of the National Hurricane Center said Tuesday to mark the opening of the 1988 Atlantic storm season.    Recently completed hurricane coastal flood models for the Atlantic and Gulf coasts show that many more people than earlier thought must be evacuated under certain conditions, said center director Bob Sheets.    Forty-three million people live in about 175 coastal counties from Maine to Texas, and evacuating crowded urban areas and barrier islands is virtually impossible, Sheets said.    There are not enough shelters to handle the added load and there are serious concerns how new glass-windowed high-rises would fare if lashed by hurricane-force winds during evacuations, he said.    During a hurricane that struck Houston, ``glass was flying everywhere,'' said Sheets.    He refused to make predictions about the 1988 hurricane season, saying no one has convinced forecasters they can reliably predict the number and severity of storms.    The first tropical depression of the year has formed, and remained stationary Tuesday night just south of the western tip of Cuba, or about 200 miles southwest of Havana. The system contained winds of up to 30 mph and was not expected to strengthen.    One of the two satellites used to keep track of hurricanes could fail this year, forecasters said.    ``It's quite possible this year that we could lose GOES-West at anytime,'' hurricane specialist Bob Case said of the Geo-Stationary Earth-Orbiting Environmental Satellite, which records atmospheric conditions over the Pacific Ocean and part of the Western Hemisphere.    If that satellite does stop working, GOES-East would have to be directed to move from its equatorial orbit over Brazil to a spot south of the Texas Gulf Coast, where it would provide a view of the Western Hemisphere with limited vision in the hurricane-spawning eastern Atlantic, he said.    A previous GOES-East expired in 1984 and temporarily deprived meteorologists of Atlantic atmospheric photographs.    A typical Atlantic hurricane season, from June 1 to Nov. 30, has 10 named tropical storms with rain and maximum sustained wind exceeding 39 mph, six of which become hurricanes with drenching rain and wind over 74 mph, Case said.    In 1987 there were only three hurricanes and four tropical storms in the Atlantic.    ";
            s = "About 2.1 million acres are smoldering from 30 fires, the federal Bureau of Land Management said.    Sue Mitchell, a BLM spokeswoman, said there were no active, or flaming, fires and all but a few firefighters have been recalled from the blazes.    Two new fires flared Wednesday in the Sierra National Forest, one over about 1,800 acres west of Kings Canyon National Park; the other near Mariposa, outside Yosemite National Park. The Mariposa blaze destroyed at least one home and grew to 250 acres.    Fire crews mobilized in the Star Valley of eastern Idaho after the 6,800-acre Trail Creek fire, fanned by shifting winds, broke through a control line and raced to within a mile of ranches and grain fields. The fire was the most threatening of 17 major blazes burning over more than 70,000 acres. Over 2,500 firefighters, backed up by National Guard personnel and equipment, were on the lines.    The 7,900-acre Eagle Bar fire near Hells Canyon at the Oregon line burned out of control for the 12th day.    The supply of fresh fire crew members dwindles as workers enter their third week of duty. The U.S. Forest Service predicted hot and dry weather well past the Labor Day weekend.    Montana's three largest fires are burning primarily in wilderness areas: the 51,000-acre Canyon Creek fire in the Scapegoat Wilderness in northwest Montana; and the 43,000-acre Storm Creek fire and 42,000-acre Hellroaring Creek fire in the Absaroka-Beartooth Wilderness north of Yellowstone National Park.    The Canyon Creek fire is burning toward several ranches outside the wilderness, while firefighters are trying to prevent the other two fires from burning south into the park.    Gov. Ted Schwinden appealed to the public Wednesday to avoid outdoor recreation over the Labor Day weekend to limit the fire risk.    The governor said 5,000 firefighters were battling blazes on 208,000 acres in Montana, and 173,000 acres burned in earlier fires. He put the cost at $15 million.    Oregon's Department of Forestry announced Wednesday that 3.8 million acres of private, state and other forest in eastern Oregon would be closed until further notice due to extreme fire danger and scarce resources to fight new blazes.";
            s="Lucas group of twelve photographic self portraits have been reproduced digitally as Iris prints in an edition of one hundred and fifty. They range from her first photographic self portrait, Eating a Banana 1990 (P78443) to the more recent Human Toilet Revisited 1998, which also exists in the Tate collection as a c-type print (Tate P78299). Photographic self portraits have been an important element of Lucas's work since the early 1990s. The seminal Eating a Banana changed Lucas's perception of her 'masculine' appearance from being a disadvantage to being something she could use in her art. 'I suddenly could see the strength of the masculinity about it - the usefulness of it to the subject struck me at that point, and since then I've used that' (Lucas quoted in Barber, p.16). The resulting confrontational self portrait photographs, made throughout the 1990s, complement her sculptural and installation work. Through them she presents an identity which challenges stereotypical representations of gender and sexuality. Posing simultaneously as tough and abject, macho but female, she creates an image of defiant femininity.";
            s = "This (with another version of the same image, ‘Black Moonlight’) was Hodgkin's second large diptych lithograph, although this time made with Judith Solodkin at Solo Press. The arrow is painted across both sheets with a stencil, and the other brushstrokes of hand-colouring are thin enough to allow the printed imagery beneath to be apparent. ";
            s = "This work is from a series called metal plate, which forms part of the body of work Crutchfield produced at the Tyler print workshop in New York from January 1977 to January 1978. The works are lithographs produced from stone and aluminum plates, with a separate plate for each colour. Crutchfield made his drawings with litho-crayon, pen and air brush. The works are printed on Arches 88 mould-made paper in editions of forty-eight with between fourteen and seventeen artist’s proofs. ";
            s = "London is a portfolio of eleven prints made by eleven artists based in London. It was commissioned by Charles Booth-Clibborn and published under his imprint, The Paragon Press, London. The images were printed and editioned at Coriander Studio, London. The portfolio was produced in an edition of sixty-five, the first forty of which are portfolio sets and the remainder are the artists' copies. A further fifteen sets were produced for artists and collaborators. Tate's copy is number five in the edition. The title and colophon pages were designed by Phil Baines using his own typeface. The portfolio is contained in a black buckram-covered wooden case bearing the title in yellow. London is the second group portfolio published by The Paragon Press since its inception in 1986.";

